"use strict";(self.webpackChunkajudafacitysistemas=self.webpackChunkajudafacitysistemas||[]).push([[799],{6011:(t,o,a)=>{a.r(o),a.d(o,{assets:()=>l,contentTitle:()=>i,default:()=>g,frontMatter:()=>e,metadata:()=>c,toc:()=>p});var n=a(4848),s=a(8453);const e={title:"Como adicionar um produto tipo Hamb\xfarguer?"},i=void 0,c={id:"cadastros/como-adicionar-um-produto-tipo-hamburguer-",title:"Como adicionar um produto tipo Hamb\xfarguer?",description:"<div dangerouslySetInnerHTML={{ html: `",source:"@site/docs/cadastros/como-adicionar-um-produto-tipo-hamburguer-.mdx",sourceDirName:"cadastros",slug:"/cadastros/como-adicionar-um-produto-tipo-hamburguer-",permalink:"/ajudafacitysistemas/en/docs/cadastros/como-adicionar-um-produto-tipo-hamburguer-",draft:!1,unlisted:!1,editUrl:"https://github.com/ajudafacity/ajudafacitysistemas/edit/main/docs/cadastros/como-adicionar-um-produto-tipo-hamburguer-.mdx",tags:[],version:"current",frontMatter:{title:"Como adicionar um produto tipo Hamb\xfarguer?"},sidebar:"tutorialSidebar",previous:{title:"Como adicionar um produto tipo a\xe7a\xed?",permalink:"/ajudafacitysistemas/en/docs/cadastros/como-adicionar-um-produto-tipo-acai-"},next:{title:"Como alterar foto de um produto?",permalink:"/ajudafacitysistemas/en/docs/cadastros/como-alterar-foto-de-um-produto-"}},l={},p=[];function r(t){return(0,n.jsx)(n.Fragment,{children:(0,n.jsx)(n.Fragment,{children:(0,n.jsx)("div",{dangerouslySetInnerHTML:{__html:'\n  \n<p></p>\n\n\n\n<p></p>\n\n\n\n<p class="has-small-font-size"></p>\n\n\n\n<p class="has-small-font-size"><strong>Passo 1: </strong>Abra o <strong>Facity Controle </strong>em seu computador</p>\n\n\n\n<p class="has-small-font-size">Para come\xe7ar, abra o <strong>Facity Controle</strong> em seu computador. Certifique-se de digitar o nome da <strong>empresa</strong>, <strong>login</strong> e<strong> senha</strong>, lembrando que tudo deve ser escrito em <strong>letras min\xfasculas</strong>.</p>\n\n\n\n<figure class="wp-block-image size-full"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" width="900" height="547" src="https://blog.facity.com.br/wp-content/uploads/2023/05/image.png" alt="" class="wp-image-1368" srcset="https://blog.facity.com.br/wp-content/uploads/2023/05/image.png 900w, https://blog.facity.com.br/wp-content/uploads/2023/05/image-300x182.png 300w, https://blog.facity.com.br/wp-content/uploads/2023/05/image-768x467.png 768w, https://blog.facity.com.br/wp-content/uploads/2023/05/image-720x438.png 720w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<p class="has-small-font-size"><strong>Passo 2: </strong>Acesse o card\xe1pio no menu lateral esquerdo</p>\n\n\n\n<p class="has-small-font-size">Dentro do painel administrativo, clique em <strong>&#8220;Card\xe1pio&#8221; </strong>no menu lateral esquerdo.</p>\n\n\n\n<figure class="wp-block-image size-full"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" width="1024" height="487" src="https://blog.facity.com.br/wp-content/uploads/2023/05/image-1.png" alt="" class="wp-image-1369" srcset="https://blog.facity.com.br/wp-content/uploads/2023/05/image-1.png 1024w, https://blog.facity.com.br/wp-content/uploads/2023/05/image-1-300x143.png 300w, https://blog.facity.com.br/wp-content/uploads/2023/05/image-1-768x365.png 768w, https://blog.facity.com.br/wp-content/uploads/2023/05/image-1-720x342.png 720w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<p class="has-small-font-size"><strong>Passo 3: </strong>Selecione a op\xe7\xe3o <strong>&#8220;Produtos&#8221;</strong></p>\n\n\n\n<p class="has-small-font-size">Na p\xe1gina do card\xe1pio, localize e clique em <strong>&#8220;Produtos&#8221;.</strong> Voc\xea pode identific\xe1-lo pela seta indicativa na imagem.</p>\n\n\n\n<figure class="wp-block-image size-full"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" width="1024" height="483" src="https://blog.facity.com.br/wp-content/uploads/2023/05/image-2.png" alt="" class="wp-image-1370" srcset="https://blog.facity.com.br/wp-content/uploads/2023/05/image-2.png 1024w, https://blog.facity.com.br/wp-content/uploads/2023/05/image-2-300x142.png 300w, https://blog.facity.com.br/wp-content/uploads/2023/05/image-2-768x362.png 768w, https://blog.facity.com.br/wp-content/uploads/2023/05/image-2-720x340.png 720w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<p class="has-small-font-size"><strong>Passo 4: </strong>Crie um novo produto</p>\n\n\n\n<p class="has-small-font-size">Para adicionar um novo produto, clique em <strong>&#8220;Novo Produto&#8221;</strong>.</p>\n\n\n\n<figure class="wp-block-image size-full"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" width="1024" height="488" src="https://blog.facity.com.br/wp-content/uploads/2023/05/image-3.png" alt="" class="wp-image-1371" srcset="https://blog.facity.com.br/wp-content/uploads/2023/05/image-3.png 1024w, https://blog.facity.com.br/wp-content/uploads/2023/05/image-3-300x143.png 300w, https://blog.facity.com.br/wp-content/uploads/2023/05/image-3-768x366.png 768w, https://blog.facity.com.br/wp-content/uploads/2023/05/image-3-720x343.png 720w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<p class="has-small-font-size"><strong>Passo 5: </strong>Preencha as informa\xe7\xf5es do produto</p>\n\n\n\n<p class="has-small-font-size">Ao clicar em <strong>&#8220;Novo Produto&#8221;</strong>, uma caixa de cadastramento ser\xe1 aberta. Nela, preencha as informa\xe7\xf5es necess\xe1rias sobre o produto:</p>\n\n\n\n<figure class="wp-block-image size-large"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" width="1024" height="400" src="https://blog.facity.com.br/wp-content/uploads/2023/05/novoedit-1024x400.png" alt="" class="wp-image-1373" srcset="https://blog.facity.com.br/wp-content/uploads/2023/05/novoedit-1024x400.png 1024w, https://blog.facity.com.br/wp-content/uploads/2023/05/novoedit-300x117.png 300w, https://blog.facity.com.br/wp-content/uploads/2023/05/novoedit-768x300.png 768w, https://blog.facity.com.br/wp-content/uploads/2023/05/novoedit-720x281.png 720w, https://blog.facity.com.br/wp-content/uploads/2023/05/novoedit.png 1323w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<p></p>\n\n\n\n<ul class="wp-block-list"><li>Nome do produto</li><li>Pre\xe7o</li><li>Descri\xe7\xe3o do produto</li><li>Se\xe7\xe3o do produto</li></ul>\n\n\n\n<figure class="wp-block-image size-large"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" width="1024" height="469" src="https://blog.facity.com.br/wp-content/uploads/2023/05/Captura-de-tela-2023-05-17-212757-1024x469.png" alt="" class="wp-image-1374" srcset="https://blog.facity.com.br/wp-content/uploads/2023/05/Captura-de-tela-2023-05-17-212757-1024x469.png 1024w, https://blog.facity.com.br/wp-content/uploads/2023/05/Captura-de-tela-2023-05-17-212757-300x137.png 300w, https://blog.facity.com.br/wp-content/uploads/2023/05/Captura-de-tela-2023-05-17-212757-768x351.png 768w, https://blog.facity.com.br/wp-content/uploads/2023/05/Captura-de-tela-2023-05-17-212757-720x330.png 720w, https://blog.facity.com.br/wp-content/uploads/2023/05/Captura-de-tela-2023-05-17-212757.png 1263w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<p class="has-small-font-size">Ap\xf3s inserir os dados, clique em <strong>&#8220;Salvar&#8221;</strong>.</p>\n\n\n\n<p class="has-small-font-size"><strong>Observa\xe7\xe3o: </strong>Se voc\xea n\xe3o possui uma se\xe7\xe3o para esse produto, \xe9 necess\xe1rio criar uma nova. </p>\n\n\n\n<p class="has-small-font-size">Siga o <strong>passo a passo</strong> abaixo:</p>\n\n\n\n<ul class="has-small-font-size wp-block-list"><li>Volte ao menu e clique em &#8220;<strong>Se\xe7\xf5es / Categorias&#8221;</strong></li></ul>\n\n\n\n<figure class="wp-block-image size-large"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" width="1024" height="426" src="https://blog.facity.com.br/wp-content/uploads/2023/05/menuedit-1024x426.png" alt="" class="wp-image-1375" srcset="https://blog.facity.com.br/wp-content/uploads/2023/05/menuedit-1024x426.png 1024w, https://blog.facity.com.br/wp-content/uploads/2023/05/menuedit-300x125.png 300w, https://blog.facity.com.br/wp-content/uploads/2023/05/menuedit-768x320.png 768w, https://blog.facity.com.br/wp-content/uploads/2023/05/menuedit-720x300.png 720w, https://blog.facity.com.br/wp-content/uploads/2023/05/menuedit.png 1355w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<ul class="has-small-font-size wp-block-list"><li>Em seguida, clique em <strong>&#8220;Nova Se\xe7\xe3o&#8221;</strong></li></ul>\n\n\n\n<figure class="wp-block-image size-large"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" width="1024" height="383" src="https://blog.facity.com.br/wp-content/uploads/2023/05/novasecaoedit-1024x383.png" alt="" class="wp-image-1377" srcset="https://blog.facity.com.br/wp-content/uploads/2023/05/novasecaoedit-1024x383.png 1024w, https://blog.facity.com.br/wp-content/uploads/2023/05/novasecaoedit-300x112.png 300w, https://blog.facity.com.br/wp-content/uploads/2023/05/novasecaoedit-768x288.png 768w, https://blog.facity.com.br/wp-content/uploads/2023/05/novasecaoedit-720x270.png 720w, https://blog.facity.com.br/wp-content/uploads/2023/05/novasecaoedit.png 1322w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<ul class="has-small-font-size wp-block-list"><li>Insira um nome para a se\xe7\xe3o e clique em <strong>&#8220;OK&#8221; </strong>para salvar</li></ul>\n\n\n\n<p></p>\n\n\n\n<figure class="wp-block-image size-large"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" width="1024" height="391" src="https://blog.facity.com.br/wp-content/uploads/2023/05/nomesecaoedit-1024x391.png" alt="" class="wp-image-1378" srcset="https://blog.facity.com.br/wp-content/uploads/2023/05/nomesecaoedit-1024x391.png 1024w, https://blog.facity.com.br/wp-content/uploads/2023/05/nomesecaoedit-300x114.png 300w, https://blog.facity.com.br/wp-content/uploads/2023/05/nomesecaoedit-768x293.png 768w, https://blog.facity.com.br/wp-content/uploads/2023/05/nomesecaoedit-720x275.png 720w, https://blog.facity.com.br/wp-content/uploads/2023/05/nomesecaoedit.png 1329w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<p class="has-small-font-size">Agora, vamos adicionar uma foto ao <strong>produto</strong> e \xe0 <strong>se\xe7\xe3o</strong>:</p>\n\n\n\n<ul class="has-small-font-size wp-block-list"><li>Volte ao menu e clique em <strong>&#8220;Produtos&#8221;</strong></li><li>Utilize a barra de pesquisa para encontrar o produto desejado</li></ul>\n\n\n\n<p></p>\n\n\n\n<figure class="wp-block-image size-large"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" width="1024" height="410" src="https://blog.facity.com.br/wp-content/uploads/2023/05/barradepesquinaedit2-1024x410.png" alt="" class="wp-image-1380" srcset="https://blog.facity.com.br/wp-content/uploads/2023/05/barradepesquinaedit2-1024x410.png 1024w, https://blog.facity.com.br/wp-content/uploads/2023/05/barradepesquinaedit2-300x120.png 300w, https://blog.facity.com.br/wp-content/uploads/2023/05/barradepesquinaedit2-768x308.png 768w, https://blog.facity.com.br/wp-content/uploads/2023/05/barradepesquinaedit2-720x289.png 720w, https://blog.facity.com.br/wp-content/uploads/2023/05/barradepesquinaedit2.png 1325w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<ul class="has-small-font-size wp-block-list"><li>Clique no <strong>\xedcone verde</strong> para editar e acessar a p\xe1gina do produto</li></ul>\n\n\n\n<figure class="wp-block-image size-large"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" width="1024" height="410" src="https://blog.facity.com.br/wp-content/uploads/2023/05/verdeedit-1024x410.png" alt="" class="wp-image-1381" srcset="https://blog.facity.com.br/wp-content/uploads/2023/05/verdeedit-1024x410.png 1024w, https://blog.facity.com.br/wp-content/uploads/2023/05/verdeedit-300x120.png 300w, https://blog.facity.com.br/wp-content/uploads/2023/05/verdeedit-768x308.png 768w, https://blog.facity.com.br/wp-content/uploads/2023/05/verdeedit-720x289.png 720w, https://blog.facity.com.br/wp-content/uploads/2023/05/verdeedit.png 1325w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<ul class="has-small-font-size wp-block-list"><li>Localize a op\xe7\xe3o <strong>&#8220;Selecionar&#8221;</strong>, conforme indicado pela seta</li><li>Clique em <strong>&#8220;Selecionar imagem&#8221;</strong> para abrir a janela de sele\xe7\xe3o de fotos</li></ul>\n\n\n\n<figure class="wp-block-image size-full"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" width="947" height="575" src="https://blog.facity.com.br/wp-content/uploads/2023/05/imagemedit.png" alt="" class="wp-image-1382" srcset="https://blog.facity.com.br/wp-content/uploads/2023/05/imagemedit.png 947w, https://blog.facity.com.br/wp-content/uploads/2023/05/imagemedit-300x182.png 300w, https://blog.facity.com.br/wp-content/uploads/2023/05/imagemedit-768x466.png 768w, https://blog.facity.com.br/wp-content/uploads/2023/05/imagemedit-720x437.png 720w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<ul class="has-small-font-size wp-block-list"><li>Procure e selecione a imagem desejada</li><li>Clique em <strong>&#8220;Abrir&#8221;</strong></li><li>Ajuste a imagem de acordo com sua prefer\xeancia</li><li>Clique em <strong>&#8220;Concluir&#8221;</strong> para adicionar a imagem</li><li>No final da p\xe1gina, clique em <strong>&#8220;Salvar&#8221;</strong></li></ul>\n\n\n\n<figure class="wp-block-image size-large"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" width="1024" height="467" src="https://blog.facity.com.br/wp-content/uploads/2023/05/selecionarimagem1-1024x467.png" alt="" class="wp-image-1383" srcset="https://blog.facity.com.br/wp-content/uploads/2023/05/selecionarimagem1-1024x467.png 1024w, https://blog.facity.com.br/wp-content/uploads/2023/05/selecionarimagem1-300x137.png 300w, https://blog.facity.com.br/wp-content/uploads/2023/05/selecionarimagem1-768x350.png 768w, https://blog.facity.com.br/wp-content/uploads/2023/05/selecionarimagem1-720x328.png 720w, https://blog.facity.com.br/wp-content/uploads/2023/05/selecionarimagem1.png 1346w" sizes="(min-width: 960px) 75vw, 100vw" /><figcaption>[</figcaption></figure>\n\n\n\n<p class="has-small-font-size">Agora, vamos adicionar uma foto \xe0 se\xe7\xe3o:</p>\n\n\n\n<ul class="has-small-font-size wp-block-list"><li>Clique em <strong>&#8220;Se\xe7\xf5es / Categorias</strong>&#8220;</li><li>Encontre a<strong> se\xe7\xe3o </strong>\xe0 qual deseja adicionar a foto</li><li>Clique no <strong>\xedcone verde</strong></li></ul>\n\n\n\n<figure class="wp-block-image size-large"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" width="1024" height="456" src="https://blog.facity.com.br/wp-content/uploads/2023/05/hamburguersecaoedit-1024x456.png" alt="" class="wp-image-1386" srcset="https://blog.facity.com.br/wp-content/uploads/2023/05/hamburguersecaoedit-1024x456.png 1024w, https://blog.facity.com.br/wp-content/uploads/2023/05/hamburguersecaoedit-300x134.png 300w, https://blog.facity.com.br/wp-content/uploads/2023/05/hamburguersecaoedit-768x342.png 768w, https://blog.facity.com.br/wp-content/uploads/2023/05/hamburguersecaoedit-720x321.png 720w, https://blog.facity.com.br/wp-content/uploads/2023/05/hamburguersecaoedit.png 1336w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<ul class="has-small-font-size wp-block-list"><li>Clique em <strong>&#8220;Selecionar&#8221;</strong></li></ul>\n\n\n\n<figure class="wp-block-image size-large"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" width="1024" height="389" src="https://blog.facity.com.br/wp-content/uploads/2023/05/secaoimagemedit-1024x389.png" alt="" class="wp-image-1385" srcset="https://blog.facity.com.br/wp-content/uploads/2023/05/secaoimagemedit-1024x389.png 1024w, https://blog.facity.com.br/wp-content/uploads/2023/05/secaoimagemedit-300x114.png 300w, https://blog.facity.com.br/wp-content/uploads/2023/05/secaoimagemedit-768x292.png 768w, https://blog.facity.com.br/wp-content/uploads/2023/05/secaoimagemedit-720x273.png 720w, https://blog.facity.com.br/wp-content/uploads/2023/05/secaoimagemedit.png 1343w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<ul class="has-small-font-size wp-block-list"><li>Selecione a imagem salva anteriormente e clique em <strong>&#8220;Abrir&#8221;</strong></li><li>Ajuste a imagem conforme sua prefer\xeancia</li><li>Clique em<strong> &#8220;Concluir&#8221;</strong></li></ul>\n\n\n\n<figure class="wp-block-image size-large"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" width="1024" height="472" src="https://blog.facity.com.br/wp-content/uploads/2023/05/selecionarimagemsecaoedit-1024x472.png" alt="" class="wp-image-1387" srcset="https://blog.facity.com.br/wp-content/uploads/2023/05/selecionarimagemsecaoedit-1024x472.png 1024w, https://blog.facity.com.br/wp-content/uploads/2023/05/selecionarimagemsecaoedit-300x138.png 300w, https://blog.facity.com.br/wp-content/uploads/2023/05/selecionarimagemsecaoedit-768x354.png 768w, https://blog.facity.com.br/wp-content/uploads/2023/05/selecionarimagemsecaoedit-720x332.png 720w, https://blog.facity.com.br/wp-content/uploads/2023/05/selecionarimagemsecaoedit.png 1345w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<ul class="has-small-font-size wp-block-list"><li>Para finalizar, clique em <strong>&#8220;Salvar&#8221;</strong></li></ul>\n\n\n\n<figure class="wp-block-image size-large"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" width="1024" height="429" src="https://blog.facity.com.br/wp-content/uploads/2023/05/salvaredit-1024x429.png" alt="Quer incluir um hamb\xfarguer delicioso no seu card\xe1pio? Com o Facity Controle, \xe9 simples! Basta cadastrar o nome, pre\xe7o e descri\xe7\xe3o do produto, e at\xe9 mesmo adicionar uma foto apetitosa. Siga nosso tutorial r\xe1pido e tenha seu hamb\xfarguer pronto para atrair clientes famintos. Vamos l\xe1, \xe9 f\xe1cil e direto ao ponto!" class="wp-image-1388" srcset="https://blog.facity.com.br/wp-content/uploads/2023/05/salvaredit-1024x429.png 1024w, https://blog.facity.com.br/wp-content/uploads/2023/05/salvaredit-300x126.png 300w, https://blog.facity.com.br/wp-content/uploads/2023/05/salvaredit-768x322.png 768w, https://blog.facity.com.br/wp-content/uploads/2023/05/salvaredit-720x302.png 720w, https://blog.facity.com.br/wp-content/uploads/2023/05/salvaredit.png 1341w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<p class="has-small-font-size">Seguindo esses passos, voc\xea conseguir\xe1 adicionar um produto tipo hamb\xfarguer ao seu card\xe1pio no <strong>Facity Controle</strong>. Experimente e aproveite!</p>\n\n'}})})})}function g(t={}){const{wrapper:o}={...(0,s.R)(),...t.components};return o?(0,n.jsx)(o,{...t,children:(0,n.jsx)(r,{...t})}):r()}},8453:(t,o,a)=>{a.d(o,{R:()=>i,x:()=>c});var n=a(6540);const s={},e=n.createContext(s);function i(t){const o=n.useContext(e);return n.useMemo((function(){return"function"==typeof t?t(o):{...o,...t}}),[o,t])}function c(t){let o;return o=t.disableParentContext?"function"==typeof t.components?t.components(s):t.components||s:i(t.components),n.createElement(e.Provider,{value:o},t.children)}}}]);